        <!-- /ko -->\n        </li>\n    </ul>\n</div>\n","Magento_ConfigurableProduct/template/variations/steps/summary-grid.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n\n<div class=\"admin__collapsible-block-wrapper opened\">\n    <div class=\"fieldset-wrapper-title\">\n        <strong class=\"admin__collapsible-title\" data-toggle=\"collapse\" data-bind=\"attr:{'data-target': '#'+id}\">\n            <span data-bind=\"text: title\"></span>\n        </strong>\n    </div>\n\n    <div class=\"fieldset-wrapper-content in collapse\" data-collapsed=\"true\" data-bind=\"attr: {id: id}\">\n        <!-- ko template: {\n            name: \"ui/grid/paging/paging\", data: paging\n            } -->\n        <!-- /ko -->\n        <div class=\"note\" data-bind=\"text: note\"></div>\n        <table class=\"data-grid data-grid-configurable\">\n            <thead>\n            <tr>\n                <th repeat=\"foreach: grid.columns, item: '$column'\" class=\"data-grid-th\" data-bind=\"text: $column\"></th>\n            </tr>\n            </thead>\n\n            <tbody>\n            <tr repeat=\"foreach: grid, item: '$product'\">\n                <!-- ko foreach: { data: $product(), as: 'property' } -->\n                <td if=\"property && property.preview\" class=\"data-grid-thumbnail-cell\">\n                    <div class=\"images-uploaded\">\n                        <img data-bind=\"attr: {src: property.preview}\"/>\n                        <span data-bind=\"text: property.images.length\"></span>\n                    </div>\n                </td>\n                <td ifnot=\"property && property.preview\">\n                    <span data-bind='text: property'></span>\n                </td>\n                <!-- /ko -->\n            </tr>\n            </tbody>\n        </table>\n    </div>\n</div>\n","Magento_ConfigurableProduct/template/components/cell-sku.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"control-table-text\">\n    <span attr=\"'data-index': index\" data-bind=\"\n        text: value,\n        css: {_disabled: disabled}\n    \">\n    </span>\n</div>\n","Magento_ConfigurableProduct/template/components/actions-list.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"action-select-wrap\" data-bind=\"\n    css : {\n        '_active' : $parent.actionsListOpened() === $record().index\n    },\n    outerClick: $parent.closeList.bind($parent, $record().index)\"\n>\n    <button class=\"action-select\" data-bind=\"click: function(){ $parent.toggleActionsList($record().index); }\">\n        <span data-bind=\"i18n: 'Select'\"></span>\n    </button>\n    <ul class=\"action-menu _active\" data-bind=\"css: {'_active': $parent.actionsListOpened() === $record().index}\">\n        <li>\n            <a class=\"action-menu-item\" data-bind=\"\n                click: function(){\n                    $parent.openModalWithGrid($record().index);\n                    $parent.closeList($record().index);\n                }\n            \">Choose a different Product</a>\n        </li>\n        <li>\n            <a class=\"action-menu-item\" data-bind=\"\n                text: $data.value() == 1 ? $t('Disable Product') : $t('Enable Product'),\n                click: function(){\n                    $parent.toggleStatusProduct($record().index);\n                    $parent.closeList($record().index);\n                }\n            \"></a>\n        </li>\n        <li>\n            <a class=\"action-menu-item\" data-bind=\"\n                click: function(){\n                    $parent.closeList($record().index);\n                    $parent.processingDeleteRecord($record().index, $record().recordId);\n                },\n                text: $t('Remove Product')\n            \"></a>\n        </li>\n    </ul>\n</div>\n","Magento_ConfigurableProduct/template/components/file-uploader.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n\n<div class=\"data-grid-file-uploader\" data-role=\"drop-zone\" css=\"_loading: isLoading\">\n    <div class=\"data-grid-file-uploader-inner\">\n        <!-- ko if: $data.processedFile().url -->\n        <img class=\"file-uploader-image\" attr=\"src: $data.processedFile().url, alt: $data.processedFile().name\"/>\n        <!-- /ko -->\n        <!-- ko if: !$data.processedFile().url && $data.thumbnail() && $data.thumbnailUrl() -->\n        <img class=\"file-uploader-image\" attr=\"src: $data.thumbnailUrl()\"/>\n        <!-- /ko -->\n        <!-- ko if: !$data.processedFile().url && !$data.thumbnail() -->\n        <text args=\"$data.processedFile().name\"/>\n        <!-- /ko -->\n        <div class=\"file-uploader-area\">\n            <input type=\"file\"\n                   class=\"file-uploader-input\"\n                   afterRender=\"onElementRender\"\n                   attr=\"id: uid, name: fileInputName, multiple: isMultipleFiles\"/>\n            <label class=\"file-uploader-button\" attr=\"for: uid, title: $t('Upload Image')\"><span translate=\"'Upload Image'\"/></label>\n            <span class=\"file-uploader-spinner\"/>\n        </div>\n    </div>\n    <!-- ko if: $data.processedFile().url || $data.thumbnail() -->\n    <div class=\"action-select-wrap\" data-bind=\"\n    css : {'_active': $data.actionsListOpened()},\n    outerClick: $data.closeList.bind($data)\"\n    >\n        <button type=\"button\" class=\"action-select\" data-bind=\"click: function(){ $data.toggleActionsList(); }\"/>\n        <ul class=\"action-menu\" data-bind=\"css: {'_active': $data.actionsListOpened()}\">\n            <li>\n                <a class=\"action-menu-item\" data-bind=\"\n                click: function(){\n                    $data.deleteImage();\n                    $data.closeList();\n                },\n                text: $t('No Image')\n            \"></a>\n            </li>\n        </ul>\n    </div>\n    <!-- /ko -->\n</div>\n","Magento_ConfigurableProduct/template/components/cell-html.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"control-table-text\">\n    <span attr=\"'data-index': index\" data-bind=\"\n        html: value,\n        css: {_disabled: disabled}\n    \">\n    </span>\n</div>\n","Magento_ConfigurableProduct/template/components/cell-status.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"control-table-text\">\n    <span attr=\"'data-index': index\" data-bind=\"\n        text: $data.value() == 1 ? $t('Enabled') : $t('Disabled'),\n        css: {_disabled: disabled}\n    \">\n    </span>\n</div>\n","Temando_Shipping/template/pickup/pickup-forward-form.html":"<!--\n/**\n * Refer to LICENSE.txt distributed with the Temando Shipping module for notice of license\n */\n-->\n<form id=\"pickup-forward-form\" autocomplete=\"off\" data-bind=\"submit: submit\" data-mage-init='{\"validation\": {}}'>\n    <label for=\"pid\" data-bind=\"i18n: 'Go to Pickup'\"></label>\n    <input class=\"input-text required-entry\" type=\"text\" id=\"pid\" name=\"pid\"\n           data-bind=\"\n            textInput: pickupId,\n            attr: {\n                placeholder: placeholder\n            }\"\n           data-validate=\"{required: true, 'validate-pickup-forward': true}\"\n           autofocus\n    />\n    <div class=\"admin__field-error\" data-bind=\"visible: messages.error()\"><span data-bind=\"text: messages.error\"></span></div>\n    <div class=\"admin__field-note\" data-bind=\"visible: messages.note()\"><span data-bind=\"text: messages.note\"></span></div>\n</form>\n","Temando_Shipping/template/attribute/mapping/product.html":"<table class=\"data-grid\" id=\"product_attribute_mapping_table\">\n    <thead>\n        <tr>\n            <th class=\"data-grid-th\" data-bind=\"i18n: 'Magento Shipping Attribute'\"></th>\n            <th class=\"data-grid-th\" data-bind=\"i18n: 'Magento Product Attribute'\"></th>\n        </tr>\n    </thead>\n    <tbody data-bind=\"foreach: getListShippingAttributes()\">\n        <tr data-role=\"row\" data-bind=\"css: { '_odd-row': $index() % 2 === 1}\">\n            <!-- ko ifnot: $parent.isNewMapping(id) -->\n            <td class=\"a-left product-attribute-mapping-column-padding\">\n                <div class=\"admin__field\">\n                    <label class=\"label admin__field-label\">\n                        <span data-bind=\"text: id\"></span>\n                    </label>\n                </div>\n                <span data-bind=\"text: description\"></span>\n            </td>\n            <!-- /ko -->\n            <!-- ko if: $parent.isNewMapping(id) -->\n            <td class=\"a-left product-attribute-mapping-column-new\" >\n                <div class=\"admin__field _required\">\n                    <label class=\"admin__field-label\"><span>product.customAttributes</span></label>\n                    <input class=\"input-text admin__control-text required-text maximum-length-255\" type=\"text\" data-bind=\"attr: {name: 'mapping['+id+'][id]'}\" data-validate=\"{'required-entry':true, 'validate-length': true}\" placeholder=\"node path\" />\n                </div>\n                <div class=\"admin__field\">\n                    <textarea class=\" textarea admin__control-textarea\" data-bind=\"attr: {name: 'mapping['+id+'][description]'}\" placeholder=\"description\"></textarea>\n                </div>\n            </td>\n            <!-- /ko -->\n            <td class=\"a-left product-attribute-mapping-column-select\">\n                <select class=\"select admin__control-select\" data-bind=\"\n                        attr: {name: 'mapping['+$data.id+'][mapped_attribute]'},\n                        options: $data.attributes,\n                        optionsText: 'label',\n                        optionsValue: 'code',\n                        value: $data.mapped_attribute,\n                        optionsCaption: ' - Select a Magento product attribute -'\n                        \">\n                </select>\n                <!-- ko if: $parent.isNewMapping(id) -->\n                <button data-bind=\"click: $parent.removeMapping, i18n: 'Cancel', attr: {id: 'remove-mapping-'+id, name: 'mapping['+id+'][remove]'}\"></button>\n                <!-- /ko -->\n                <!-- ko if: $parent.canDelete(id, is_default) -->\n                <button type=\"button\" data-bind=\"click: function () { $parent.deleteMapping(id, $parent.deleteUrl, $parent.token); }, i18n: 'Delete'\"></button>\n                <!-- /ko -->\n            </td>\n        </tr>\n    </tbody>\n</table>\n\n<div class=\"admin__data-grid-filters-wrap _show\">\n    <div class=\"admin__data-grid-filters-footer\">\n        <div class=\"admin__footer-main-actions\">\n            <button data-bind=\"click: newMapping, i18n: 'New Mapping'\"></button>\n        </div>\n    </div>\n</div>\n","Temando_Shipping/template/grid/cells/actions.html":"<!--\n/**\n * Refer to LICENSE.txt distributed with the Temando Shipping module for notice of license\n */\n-->\n<a\n        class=\"action-menu-item\"\n        if=\"$col.isSingle($row()._rowIndex)\"\n        repeat=\"foreach: $col.getVisibleActions($row()._rowIndex), item: '$action'\"\n        click=\"$col.getActionHandler($action())\"\n        text=\"$action().label\"\n        attr=\"target: $col.getTarget($action()), href: $action().href\"/>\n\n<div class=\"action-select-wrap\" if=\"$col.isMultiple($row()._rowIndex)\" collapsible>\n    <button class=\"action-select\" type=\"button\" translate=\"'Select'\" toggleCollapsible/>\n    <ul class=\"action-menu\" css=\"_active: $collapsible.opened\">\n        <li repeat=\"foreach: $col.getVisibleActions($row()._rowIndex), item: '$action'\">\n            <a class=\"action-menu-item\" click=\"$col.getActionHandler($action())\" text=\"$action().label\" attr=\"target: $col.getTarget($action()), href: $action().href, 'data-action': 'item-' + $action().index\"/>\n        </li>\n    </ul>\n</div>\n","Temando_Shipping/template/grid/cells/html.html":"<div class=\"data-grid-cell-content expandable\">\n    <p>\n        <span data-bind=\"html: $col.getLabel($row())\"></span>\n        <a href=\"#\"\n           data-bind=\"\n            click: toggleShowFull.bind($data, $col, $row()),\n            text: $row().services_link,\n            visible: $row().services_expandable\n           \">\n        </a>\n    </p>\n</div>\n","Temando_Shipping/template/components/init.html":"<!-- ko foreach: getRegion('init') -->\n<!-- ko template: getTemplate() --><!-- /ko -->\n<!--/ko-->\n","Magento_GroupedProduct/template/product/price/regular_price.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n","Magento_GroupedProduct/template/product/price/minimal_price.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<if args=\"isSalable($row())\">\n    <div class=\"minimal-price\">\n        <span if=\"label\"\n              class=\"price-label\"\n              text=\"label\"/>\n\n        <span class=\"price-container\"\n              css=\"getAdjustmentCssClasses($row())\">\n            <span class=\"price-wrapper price-including-tax\"\n                  data-price-amount=\"\"\n                  data-price-type=\"\"\n                  html=\"getPrice($row())\"/>\n\n            <each args=\"data: getAdjustments(), as: '$adj'\">\n                <render args=\"$adj.getBody()\"/>\n            </each>\n        </span>\n    </div>\n</if>\n","Magento_GroupedProduct/template/components/position.html":"<div class=\"position\">\n    <a href=\"#\" class=\"move-top icon-backward icon-rearrange-position\"\n       data-bind=\"\n            click: $parent.sendToTop.bind($parent)\n            \">\n        <span>Top</span>\n    </a>\n    <input type=\"text\" class=\"position-widget-input\"\n           data-bind=\"\n                value: $parent.getCalculatedPosition($record()),\n                event: {blur: $parent.updateGridPosition.bind($parent)}\n            \"/>\n    <a href=\"#\" class=\"move-bottom icon-forward icon-rearrange-position\"\n       data-bind=\"\n            click: $parent.sendToBottom.bind($parent)\n            \">\n        <span>Bottom</span>\n    </a>\n</div>\n","Magento_Tinymce3/tiny_mce/plugins/preview/example.html":"<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n<script language=\"javascript\" src=\"../../tiny_mce_popup.js\"></script>\n<script type=\"text/javascript\" src=\"jscripts/embed.js\"></script>\n<script type=\"text/javascript\">\ntinyMCEPopup.onInit.add(function(ed) {\n\tvar dom = tinyMCEPopup.dom;\n\n\t// Load editor content_css\n\ttinymce.each(ed.settings.content_css.split(','), function(u) {\n\t\tdom.loadCSS(ed.documentBaseURI.toAbsolute(u));\n\t});\n\n\t// Place contents inside div container\n\tdom.setHTML('content', ed.getContent());\n});\n</script>\n<title>Example of a custom preview page</title>\n</head>\n<body>\n\nEditor contents: <br />\n<div id=\"content\">\n<!-- Gets filled with editor contents -->\n</div>\n\n</body>\n</html>\n","Magento_Tinymce3/tiny_mce/plugins/preview/preview.html":"<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n<script type=\"text/javascript\" src=\"../../tiny_mce_popup.js\"></script>\n<script type=\"text/javascript\" src=\"jscripts/embed.js\"></script>\n<script type=\"text/javascript\"><!--\ndocument.write('<base href=\"' + tinyMCEPopup.getWindowArg(\"base\") + '\">');\n// -->\n</script>\n<title>{#preview.preview_desc}</title>\n</head>\n<body id=\"content\">\n<script type=\"text/javascript\">\n\tdocument.write(tinyMCEPopup.editor.getContent());\n</script>\n</body>\n</html>\n","Magento_Sales/templates/order/create/payment/reload.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n\n<div class=\"admin__page-section-title\">\n    <span class=\"title\"><%- data.title %></span>\n</div>\n<div id=\"order-billing_method_summary\"\n     class=\"order-billing-method-summary\">\n    <a href=\"#\"\n       onclick=\"return order.loadPaymentMethods();\"\n       class=\"action-default\">\n        <span><%- data.linkText %></span>\n    </a>\n</div>\n","Magento_Sales/templates/order/create/shipping/reload.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n\n<div class=\"admin__page-section-title\">\n    <span class=\"title\"><%- data.title %></span>\n</div>\n<div id=\"order-shipping-method-summary\"\n     class=\"order-shipping-method-summary\">\n    <a href=\"#\"\n       onclick=\"return order.loadShippingRates();\"\n       class=\"action-default\">\n        <span><%- data.linkText %></span>\n    </a>\n    <input type=\"hidden\" name=\"order[has_shipping]\" value=\"\" class=\"required-entry\" />\n</div>\n","Magento_Catalog/template/image-preview.html":"<!--\n/**\n * Copyright \u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"file-uploader-summary\">\n    <div class=\"file-uploader-preview image-uploader-preview\">\n        <a class=\"image-uploader-preview-link\" attr=\"href: $parent.getFilePreview($file)\" target=\"_blank\">\n            <div class=\"file-uploader-spinner image-uploader-spinner\" />\n            <img\n                class=\"preview-image\"\n                tabindex=\"0\"\n                event=\"load: $parent.onPreviewLoad.bind($parent)\"\n                attr=\"\n      